import React from "react";
import "./Navbar.css";

const Navbar = () => {
  return (
    <nav>
      <div className="nav">
        <div>
          <h1>Plastaps</h1>
        </div>
        <div className="buy_sell_btn">
          <button className="button">Buy</button>
          <button>Sell</button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
